import React from "react";
import "./Header.css";

let i = 0
let text = "Hi, I'm Michael Sabzevari!"
let speed = 50
function typeWriter(){
  if (i < text.length) {
    text.charAt(i);
    i++;
    setTimeout(typeWriter, speed);
  }
}
function Header() {
    return (
      <div className="header">
        <div className="title typewriter">
          <h1>{this.typeWriter()}</h1>
          <h2>Software Engineer in NYC</h2>
        </div>
      </div>
    );
  }

  export default Header;
